import { legacy_createStore as createStore } from 'redux';

const initialState = {
    favorites:[],
    displayFavorites: false
  }

  const reducer = (state=initialState, action) => {
    switch (action.type) {
      default:
        return state;
    }
  }

  export const store = createStore(reducer);

  export default reducer;
